const jsonPromise = async function fetchData(){
  let response = await fetch('http://localhost:5000/api/get_rpi_info');
  let data = await response.json();
  data = JSON.stringify(data);
  data = JSON.parse(data);
  return data;
 }

 let abc = jsonPromise(); // here the data will be return.
 console.log(abc); // you are using async await then no need of .then().

 const initState = {};

const projectReducer = (state = initState, action) => {
  switch (action.type) {
    case 'ADD_PROJECT':
      console.log('created project', action.project);
      break;
    default: 
      break;
  }
  return state;
}

export default projectReducer;
